import './App.css';
import Films from "./components/Movie/Films";
import NavBar from "./components/NavBar/NavBar";
import FilmsPage from "./components/Movie/FilmsPage";
import {Switch, Route} from "react-router-dom";
function App() {
    return (
        <Switch>
        <div className='App'>
            <Switch>
            <NavBar/>
                <Route path='/'>
                    <Films/>
                </Route>
                <Route path="/movies">
                    <FilmsPage/>
                </Route>
            </Switch>
        </div>
        </Switch>
    );
}

export default App;
